public class InnerIntegrationSourceConnectorPropertiesFactory(Action<Humidifier.CustomerProfiles.IntegrationTypes.SourceConnectorProperties> factoryAction = null) : SubResourceFactory<Humidifier.CustomerProfiles.IntegrationTypes.SourceConnectorProperties>
{

    internal InnerIntegrationS3SourcePropertiesFactory S3Factory { get; set; }

    internal InnerIntegrationServiceNowSourcePropertiesFactory ServiceNowFactory { get; set; }

    internal InnerIntegrationZendeskSourcePropertiesFactory ZendeskFactory { get; set; }

    internal InnerIntegrationMarketoSourcePropertiesFactory MarketoFactory { get; set; }

    internal InnerIntegrationSalesforceSourcePropertiesFactory SalesforceFactory { get; set; }

    protected override Humidifier.CustomerProfiles.IntegrationTypes.SourceConnectorProperties Create()
    {
        var sourceConnectorPropertiesResult = CreateSourceConnectorProperties();
        factoryAction?.Invoke(sourceConnectorPropertiesResult);

        return sourceConnectorPropertiesResult;
    }

    private Humidifier.CustomerProfiles.IntegrationTypes.SourceConnectorProperties CreateSourceConnectorProperties()
    {
        var sourceConnectorPropertiesResult = new Humidifier.CustomerProfiles.IntegrationTypes.SourceConnectorProperties();

        return sourceConnectorPropertiesResult;
    }
    public override void CreateChildren(Humidifier.CustomerProfiles.IntegrationTypes.SourceConnectorProperties result)
    {
        base.CreateChildren(result);

        result.S3 ??= S3Factory?.Build();
        result.ServiceNow ??= ServiceNowFactory?.Build();
        result.Zendesk ??= ZendeskFactory?.Build();
        result.Marketo ??= MarketoFactory?.Build();
        result.Salesforce ??= SalesforceFactory?.Build();
    }

} // End Of Class

